import React from 'react'
import styled from 'styled-components';

function Game() {
    return (
        <Container>
            <ContainerChildLeft>
                <h4>Department</h4>
                <h5>Computers</h5>
                <div>
                    <p>Computer Accessories & Peripherals</p>
                    <p>Computer Components</p>
                    <p>Computers & Tablets</p>
                    <p>Data Storage</p>
                    <p>Laptop Accessories</p>
                    <p>Monitors</p>
                    <p>Networking Products</p>
                    <p>Power Strips & Surge Protectors</p>
                    <p>Printers</p>
                    <p>Scanners</p>
                    <p>Servers</p>
                </div>
               
       
            </ContainerChildLeft>
            <ContainerChildRight>
                <h2>Computers, Tablets and IT Accessories</h2>
                <p>Shop laptops, desktops, monitors, tablets, PC gaming, hard drives and storage, accessories and more</p>
                <div>
                    <p>1-12 of over 80,000 results for Computers</p>
                </div>
            </ContainerChildRight>
        </Container>
    )
}

export default Game

const Container = styled.div`
    display: flex;
`

const ContainerChildLeft = styled.div`
    margin-top:10px;
    width:200px;
    background-color: white;
    padding:10px;
    border-right:1px solid rgb(236,229,237);
    h5{
        margin-left:5px;
    }
    div{
        margin-left:14px;
    }
    
`

const ContainerChildRight = styled.div`
    
    background-color: white;
    flex-grow:1;
    padding:10px;
    div{
        margin-top: 20px;
        margin-right: 10px;
        margin-left:7px;
        border: 1px solid rgb(236,229,237);
        height:50px;
        padding-top:15px;
        padding-left:30px;
    }
`
